import React from 'react';
import "./Login.css";
import logo from './image.png';
import icon from './Userlogo.png';
import passicon from './passicon.png';
import usericon from './usericon.png';

const App = () => {
    return (
    <div className="body">
        <img id='amakilogo' src={logo} alt='icon'></img>
        <div className='login'>
        <img id='user' src={icon} alt='logo'></img>
            <h1>Login</h1>
            <div className='username'>
                <p>Username</p>
                <img id='userlogo' src={usericon} alt='user'></img>
                <input type="text" id='usernamebox'></input>
            </div>
            <div className='password'>
                <p>Password</p>
                <img id='passlogo' src={passicon} alt='pass'></img>
                <input type="password" id='passnamebox'></input>
            </div>
            <div className='button'>Sign in</div>
        </div>
    </div> 
    );
}

export default App;
